import React, { Component } from 'react'

import { initGA, logPageView } from '../utils/analytics'

export default class Analytics extends Component {
    componentDidMount () {
        if (!window.GA_INITIALIZED) {
          initGA()
          window.GA_INITIALIZED = true
        }
        logPageView()
      }
    render() {
        return (
            <div>
                
            </div>
        )
    }
}
